import React from 'react';
import { BrowserRouter as Router, Route} from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";

function App() {
  return ( 
    <Router>
    <div className="container">
      Hello World!
    </div>
    </Router>
  );
}

export default App;
